(133, 'MD SAHADAT HOSSEN SAJIB', 'sahadathossensajib@gmail.com', '01722455531', NULL, '$2y$12$XHXbttWL/UYPSTVQk8VS4OaglzHp9wUtPc7yYsdHqslnI0E63..1C', 'https://res.cloudinary.com/dbqoevq35/image/upload/v1761579105/minimal-LLM/on0nlhs5o38rw7mu7nky.png', 'student', 'active', 1, 'B.Sc. in Computer Science and Engineering, Varendra University (2022)\nCGPA: 3.78/4.00 (Top 5% of the class)\nSpecialization: AI, Machine Learning, Data Science\n\nKey Courses:\nArtificial Intelligence\nDigital Signal Processing\nComputer Networks\nMachine Learning\nData Science\nAlgorithms and Data Structures\n\nThesis: Developed a Conversational Voice Assistant using Natural Language Processing (NLP) and Machine Learning to help local users interact with AI-powered systems more efficiently.', 'Research Assistant\nResearch & Skill Development Society | Dhaka, Bangladesh\nApril 2023 â€“ Present\nLead research on AI solutions for agriculture and disaster management, focusing on the use of machine learning for crop disease detection and real-time flood prediction.\nPublished research on Vision Transformers for crop disease detection (achieved 99.91% accuracy).\nDeveloped deep learning models for evapotranspiration estimation to improve water resource management through sensor integration and distributed networks.\n\nFreelance Web Developer & AI Integration\nSelf-employed (Fiverr/Upwork) | Remote\nJuly 2017 â€“ Present\nDelivered 300+ web development projects, integrating AI tools for smarter, more efficient websites across multiple industries.\nWorked with clients globally, creating responsive websites with advanced features like chatbots, NLP, and predictive analytics.\nManaged and led client interactions, ensuring high-quality project execution and 5-star ratings.\n\nWeb Developer & Digital Marketing Expert\nKodekrafters Technologies | California, USA\nSep 2022 â€“ July 2024\nBuilt 50+ responsive websites and apps integrating AI analytics to enhance user engagement by 30%.\nApplied digital marketing strategies, boosting client conversion rates through targeted campaigns.\nWorked with cross-functional teams to implement AI-driven solutions for client websites.', 'I am a B.Sc. in Computer Science and Engineering graduate from Varendra University, with a CGPA of 3.78/4.00 and a strong foundation in AI, machine learning, and data science. I am deeply passionate about applying advanced AI techniques to solve real-world challenges, particularly in the fields of sustainable agriculture, disaster management, and communications networks. Through my research, publications, and hands-on projects, I am dedicated to advancing data-driven solutions that can transform industries and address global issues. With a career focus on AI-driven communications systems and IoT, I aim to contribute to the development of next-generation technologies in the evolving landscape of 5G/6G networks.', 'Preparing for PhD', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-12-23 07:17:39', '2025-12-23 07:17:39'),
